import React from "react";
import Navbar from "./navmenu/Navbar";
import Contact from "./Contact";
import { useTheme } from "@material-ui/core/styles";
import { withStyles } from "@material-ui/core/styles";
import animalImg from "../img/animal.jpg";
import angryCatImg from "../img/angrycat.jpg";

import {
  Box,
  Button,
  Typography,
  Avatar,
  Link,
  Divider,
} from "@material-ui/core";

const styles = (theme) => ({});

const BlogListEntry = (props) => {
  const { classes } = props;

  //   const classes = useStyles();
  const theme = useTheme();
  return (
    <>
      <Box>
        <Box
          style={{
            display: "flex",
            justifyContent: "space-between",
            minHeight: "100px",
            // border: "2px white solid",
            alignItems: "center",
          }}
        >
          <Box
            style={{
              flexBasis: "14%",
              justifyContent: "center",
            }}
          >
            <Avatar
              alt="Remy Sharp"
              src={animalImg}
              style={{
                width: "90%",
                height: "auto",
                maxWidth: "200px",
                border: `.3rem ${theme.palette.accent1.main} solid`,
                margin: "auto",
              }}
            ></Avatar>
          </Box>
          <Box style={{ flexBasis: "82%" }}>
            <Link href="#" variant="h6" style={{ color: "white" }}>
              {'"animal"'}
            </Link>
            <Typography
              variant="body1"
              style={{ color: theme.palette.accent1.main }}
            >
              the picture I found when searching for "animal" on google
            </Typography>
          </Box>
        </Box>
      </Box>
      <Divider />
    </>
  );
};

export default withStyles(styles)(BlogListEntry);
